import React from 'react';
import Router from 'next/router';

export default () => {
  useEffect(() => {
    const jwt = window.sessionStorage.getItem('jwt');
    if(!jwt){
      Router.push('/login');
    }
  }, []);
  <h1>Hello World</h1>;
}
